import { Carousel } from 'react-responsive-carousel';


const TopNews = () => {
    
    
    
    return (  
       <div className="top-news">
          <div className="image">

          </div>
          <Carousel>
             <div>
                <h1>The Global IPO Market Has Never Been Hotter Than It Is Right Now</h1>
                <p>News Description</p>
             </div>
          </Carousel>
       </div>
    );
}
 
export default TopNews;
